 ('af0514d1365d08c55075194942cdf2c25a3d33486f000084002999','0','0',0,'0',2517,'<?xml version=\"1.0\"?>\n<AirDocument version=\"1.0.0\"><DocHeader><DocIdent><UUID>af0514d1365d08c55075194942cdf2c25a3d33486f000084002999</UUID><Status>0</Status><KeyDiscriminator>0</KeyDiscriminator><SerialNo>0</SerialNo><SerialType>0</SerialType></DocIdent><DocControl><DocType>af2cf1ea9ac27e03334e8abc0ead38e9042f01366a00003336ecf4</DocType><DocName>AIR V0.4: JavaScript Support</DocName><Origin><Creation><EntityId>af2f02c76e74c55c9b93d518447e093ed3a61ea9590000e4c5d72e</EntityId><Timestamp>20051209134241-0800</Timestamp></Creation><LastChange><Type>I</Type><EntityId>af2f02c76e74c55c9b93d518447e093ed3a61ea9590000e4c5d72e</EntityId><Timestamp>20051209134241-0800</Timestamp><Comment>Original Entry</Comment></LastChange></Origin><ChangePending>N</ChangePending><EffectiveFrom>20051209134241-0800</EffectiveFrom><EffectiveTo>20051209134241-0800</EffectiveTo><Manifest><ItemCount>0</ItemCount></Manifest></DocControl></DocHeader><DocBody><EleDict><ItemCount>0</ItemCount></EleDict><ElementControl/><ElementData><PrefLabel/><ShortName/><Abstract>There is a need to be able to support a certain amount of JavaScript processing.</Abstract><Purpose>JavaScript would enable a certain amount of off-loading of work onto the client machine. This enables an AJAX form of architecture. Also, JavaScript support is required to be able to support pop-up windows for help and related types of reference, where the user can bring up multiple views of the data simultaneously for comparison or reference.</Purpose><Description>Overall this ability either will require some degree of enforcement that for selected types of use JavaScript is required, or it will require dual coding for JS enabled cleints, and non-JS enabled clients.&#xD;\n&#xD;\nJScript sould be cataloged as individual procedures that may be required, possibly with parameters to tailor them to the form name or field names. Then, as the are determined, they should  be checked off. The final output processing step needs to review the list and provide scripts, or instructions for script location, to the browser.</Description><Issues>Since the introduction of the initial JavaScript processing (circa 0.4.49) Apache has been periodically dumping. This may or may not be caused by the JavaScript, and/or the fact that the client and server are on the same machine.</Issues><Edits>This required the inclusion of additional features to begin the ability to do a background client interrogation about client capabilities.</Edits></ElementData></DocBody></AirDocument>\n');
