where the values need to be managed and synchronized with a consistent value, and binary objects such as pictures or binary files. </Purpose><Description/><EleClass>af82385e3cb80a2aae706f7b565c9bf739ff3c3f8e0000bc440d01</EleClass><ConceptLvl>afb3581e128edb6fa2df5320b88cbe687dece12583000034906287</ConceptLvl><SysLevel>af6bbe5985c6ea0730d912a0f10c13c911235389b30000cc42de31</SysLevel><Edits/><Issues/></ElementData></DocBody></AirDocument>\n');
