 ('af8f0dd52cf6a4bdd10cdf2a54f762c930371169560000fafa55f7','0','0',0,'0',2173,'<?xml version=\"1.0\"?>\n<AirDocument version=\"1.0.0\"><DocHeader><DocIdent><UUID>af8f0dd52cf6a4bdd10cdf2a54f762c930371169560000fafa55f7</UUID><Status>0</Status><KeyDiscriminator>0</KeyDiscriminator><SerialNo>0</SerialNo><SerialType>0</SerialType></DocIdent><DocControl><DocType>af217602484bb82446010921e1e079376c983418fa0000044d4742</DocType><DocName>AIR V0.4: AIR: Element Display Print Option</DocName><Origin><Creation><EntityId>af2f02c76e74c55c9b93d518447e093ed3a61ea9590000e4c5d72e</EntityId><Timestamp>20051005151548-0400</Timestamp></Creation><LastChange><Type>U</Type><EntityId>af2f02c76e74c55c9b93d518447e093ed3a61ea9590000e4c5d72e</EntityId><Timestamp>20080403203323+0000</Timestamp><Comment>Modification</Comment></LastChange></Origin><ChangePending>N</ChangePending><EffectiveFrom>20051005151548-0400</EffectiveFrom><EffectiveTo>20051005151548-0400</EffectiveTo><Manifest><ItemCount>0</ItemCount></Manifest></DocControl></DocHeader><DocBody><EleDict><ItemCount>0</ItemCount></EleDict><ElementControl/><ElementData><PrefLabel/><ShortName>Print Option</ShortName><Abstract></Abstract><Purpose></Purpose><Description>It would be useful to have a PRINT buton on element screens that would cause the creation of a new screen that was specifically intented as a browser print screen for the detail element contents.  The print screen should eliminate the side columns of the main interaction screens and allow the center column to be page wide. This will eliminate the left and right side bar data from printed output, and hopefully will cause browser based print to be better formatted as a form of output. For the print option almost all data should be displayed as straight tabluar output with no need for text labels on fields as is done with current form based output. In addition, use of table cell output rather than text input boxed data and text boxes will provide a better result that does not truncate paragraphs. This can serve as an early surrogate for creation of PDF output. At that time, both the browser based and PDF options should exist side by side as alternatives.</Description><Issues></Issues><Edits></Edits></ElementData></DocBody></AirDocument>\n'),
