 ('af937727f8ea373429a86bd12e589727cef2a0d3350000fb82b6e4','0','0',0,'0',2254,'<?xml version=\"1.0\"?>\n<AirDocument version=\"1.0.0\"><DocHeader><DocIdent><UUID>af937727f8ea373429a86bd12e589727cef2a0d3350000fb82b6e4</UUID><Status>0</Status><KeyDiscriminator>0</KeyDiscriminator><SerialNo>0</SerialNo><SerialType>0</SerialType></DocIdent><DocControl><DocType>af2cf1ea9ac27e03334e8abc0ead38e9042f01366a00003336ecf4</DocType><DocName>AIR V0.4: Enhanced List View</DocName><Origin><Creation><EntityId>af2f02c76e74c55c9b93d518447e093ed3a61ea9590000e4c5d72e</EntityId><Timestamp>20051010170140-0400</Timestamp></Creation><LastChange><Type>I</Type><EntityId>af2f02c76e74c55c9b93d518447e093ed3a61ea9590000e4c5d72e</EntityId><Timestamp>20051010170140-0400</Timestamp><Comment>Original Entry</Comment></LastChange></Origin><ChangePending>N</ChangePending><EffectiveFrom>20051010170140-0400</EffectiveFrom><EffectiveTo>20051010170140-0400</EffectiveTo><Manifest><ItemCount>0</ItemCount></Manifest></DocControl></DocHeader><DocBody><EleDict><ItemCount>0</ItemCount></EleDict><ElementControl/><ElementData><PrefLabel/><ShortName>Enhanced List</ShortName><Abstract>Some form of enhanced list view needs to show more information about the elements. Perhaps there might be a series of \"lists\" that can be viewed as the \"show collection\" menu pick that show a variety of detail that is in the index database. There may also need to be some adjustment to what is carried in the index database. Alternatively, some lists might be dynamically formed by executing queries. Some things that would be useful include lists of types that define the number of defined in the type categories, including a list that then filters those items without details, so when selectiuons are made, there is always something there to select.</Abstract><Purpose>These lists are needed to provide a more productive navigation and working environment for working with the actual models that are defined.</Purpose><Description/><Issues/><Edits>It may be helpful to have lists filter in both directions. (a) only item types that have details, (b) only item types WITHOUT details [in order to define what still needs detailing, or possible elimination], and (c) both with and with [all item types ... similar to the current list view].</Edits></ElementData></DocBody></AirDocument>\n'),
