 ('afb30f514c0b2baeabb4792fab98deb784c8ede3060000539f319f','0','0',0,'0',2965,'<?xml version=\"1.0\"?>\n<AirDocument version=\"1.0.0\"><DocHeader><DocIdent><UUID>afb30f514c0b2baeabb4792fab98deb784c8ede3060000539f319f</UUID><Status>0</Status><KeyDiscriminator>0</KeyDiscriminator><SerialNo>0</SerialNo><SerialType>0</SerialType></DocIdent><DocControl><DocType>af217602484bb82446010921e1e079376c983418fa0000044d4742</DocType><DocName>AIR V0.4: BEAMS: Graphical Interface</DocName><Origin><Creation><EntityId>af2f02c76e74c55c9b93d518447e093ed3a61ea9590000e4c5d72e</EntityId><Timestamp>20050929021518-0400</Timestamp></Creation><LastChange><Type>I</Type><EntityId>af2f02c76e74c55c9b93d518447e093ed3a61ea9590000e4c5d72e</EntityId><Timestamp>20050929021518-0400</Timestamp><Comment>Original Entry</Comment></LastChange></Origin><ChangePending>N</ChangePending><EffectiveFrom>20050929021518-0400</EffectiveFrom><EffectiveTo>20050929021518-0400</EffectiveTo><Manifest><ItemCount>0</ItemCount></Manifest></DocControl></DocHeader><DocBody><EleDict><ItemCount>0</ItemCount></EleDict><ElementControl/><ElementData><PrefLabel/><ShortName>Graphical Interface</ShortName><Abstract/><Purpose/><Description>Most modeling tools provide a graphical interface. The current work on BEAMS is focused on the internal shape and packaging of the structured data and the algorithms for analyzing and evaluating that data. While some form of graphical visual output can be produced, such as AT&amp;T GraphViz type outps, those are faily simplistic. They have significant value, but they do not reach the realm of what would truely be called high level architectural drawings. Rather they are more similar to DETAILS in a set of architectural blueprints.&#xD;\nConceptually, the current code is designed as a server that could accomodate multiple, diverse front-end interfaces. For example, web-based, .NET and Java fron-ends can all be supported. It would be beneficial to create a front-end in eclipse, and another front-end using a .NET windows development environment, perhaps as a visual studio plug-in.&#xD;\nYet another form of interface can be accomplished as a VISIO plug-in. Using VISIO, SMART shapes can catalog and cross reference a VISIO drawing to BEAMS database objects. The drawing itself could then be cataloged in the AIR database. This would allow the user to shape the architecture drawing as per their own desire for format, object type, etc. and then to have BEAMS hyperlink support for the models and the interaction and cross impact of various drawing against each other, and against other specifications that are not necessirily included in any drawings. Similar interfaces can be developed for other MIcrosoft products for those object types that correspond, e.g., Project, etc.  This minimizes the need for major develoment expense and opens up an easy access path to entry in the Microsoft developer community. Eclipse can be used for similar entry in the Java developer community.</Description><Issues/><Edits/></ElementData></DocBody></AirDocument>\n'),
