 ('affbd65c412b4ffbf8361579543b246216492e29f00000bbd7cc72','0','0',0,'0',1956,'<?xml version=\"1.0\"?>\n<AirDocument version=\"1.0.0\"><DocHeader><DocIdent><UUID>affbd65c412b4ffbf8361579543b246216492e29f00000bbd7cc72</UUID><Status>0</Status><KeyDiscriminator>0</KeyDiscriminator><SerialNo>0</SerialNo><SerialType>0</SerialType></DocIdent><DocControl><DocType>af537e70d4fa49be51d26c5db7b6ba680cb69eba780000b2c092e8</DocType><DocName>AIR V0.4: Multiple Window Management</DocName><Origin><Creation><EntityId>af2f02c76e74c55c9b93d518447e093ed3a61ea9590000e4c5d72e</EntityId><Timestamp>20051213012127-0800</Timestamp></Creation><LastChange><Type>I</Type><EntityId>af2f02c76e74c55c9b93d518447e093ed3a61ea9590000e4c5d72e</EntityId><Timestamp>20051213012127-0800</Timestamp><Comment>Original Entry</Comment></LastChange></Origin><ChangePending>N</ChangePending><EffectiveFrom>20051213012127-0800</EffectiveFrom><EffectiveTo>20051213012127-0800</EffectiveTo><Manifest><ItemCount>0</ItemCount></Manifest></DocControl></DocHeader><DocBody><EleDict><ItemCount>0</ItemCount></EleDict><ElementControl/><ElementData><PrefLabel/><ShortName/><Abstract/><Purpose/><Description>Popup windows generated during a single session appear to carry the same PHP session. This is in contrast to new browser windows started on the same machine. In general, this would be a good thing. However, it requires caution to ensure that the user is not performing conflicting updates from multiple windows.&#xD;\n&#xD;\nIn addition to the multiple window update issue, there is a general window management issue. Popup windows should be considered reference windows and slaves to the master window (defined as the original session window). Session control should reside with the master window. Any logoff or close action taken on the master should impact the slave windows. For FireFox, it appears that closing the master wqindow will close the popup child windows. This is NOT the behavior exhibited by IE.</Description><Issues/><Edits/></ElementData></DocBody></AirDocument>\n');
